Wer von euch hat Bloodstained gespielt? 😊
Für mich, als großen Fan von #metroidvania Spielen, war das quasi ein Pflichttitel und ich mochte den angenehm hohen Schwierigkeitsgrad. Dazu gabs ne überraschend komplexe Handlung und ein hervorragendes Gameplay. Nur technisch konnte mich die Switch Version nicht völlig überzeugen. Trotzdem ein tolles Spiel und ich freue mich darauf, das Spiel umfassend auf meinem Blog vorzustellen! 😊

